車種別専用リアエンブレムシートです。※注※こちらの商品はシートのみで、エンブレムは付属しません。<br>車種別にカットしてある為、誰でも簡単に貼るだけでドレスアップすることが可能です！<br><br>【ハセ・プロ】マジカルカーボンシリーズは炭素繊維素材、及びガラス繊維素材を特殊技術により柔軟性をもたせ特殊印刷で仕上げた高級なシートです。<br>本物のカーボンファイバーなので、保護力十分！特殊加工により防水性に優れ、水がしみ込むことがありません。<br>ヒートサイクルテスト純正基準及び耐候性3年テストに合格し、優れた耐久性、耐候性が認められています。<br><br>メーカー：ハセ・プロ<br>品番： CET-21GU<br>カラー：ガンメタ<br>使用場所：リアエンブレム<br><br>【適合車種】<br><br>・プロボックス NLP/NCP50系(2002.7～)<style type="text/css">
